I just tried a few things and doing the following works:

```
model2.Run(Fix(model1.Run(data), model2))

private static List<NamedOnnxValue> Fix(IDisposableReadOnlyCollection<DisposableNamedOnnxValue> t, InferenceSession model)
{
    var q = t.First().AsTensor<float>();
    var dims = q.Dimensions;
    var data = q.ToArray();
    var tensor = new DenseTensor<float>(data, dims);
    var name = model.InputMetadata.Keys.First();
    return new List<NamedOnnxValue> { NamedOnnxValue.CreateFromTensor(name, tensor) };
}
```
So yes, both models work individually.

I have created a minimal model that reproduces the problem:

[models.zip](https://github.com/microsoft/onnxruntime/files/4185375/models.zip)

Run the following in a c# application after having loaded the models:
```
head.Run(base.Run(data))
```

The two models are implemented in PyTorch like this:

```
class BaseModel(nn.Module):
    def __init__(self):
        super(BaseModel, self).__init__()
        self.conv = torch.nn.Conv2d(1, 64, kernel_size=3, stride=1, padding=1)

    def forward(self, x):
        return self.conv(x)


class Head(nn.Module):
    def __init__(self):
        super(Head, self).__init__()
        self.conv = torch.nn.Conv2d(64, 128, kernel_size=3, stride=1, padding=1)

    def forward(self, x):
        return self.conv(x)
```

Hi,

I finally got around to investigating this. I used your sample models (thanks) and there are several takeaways:

1) The output (tensor) of Run() is of type `DisposableNamedOnnxValue` and the input tensor of Run() is of type `NamedOnnxValue`. `DisposableNamedOnnxValue` is a derived class of `NamedOnnxValue` and hence Run() accepts the output of another Run(). Unfortunately, there is logic in the Run() to pin managed memory buffer in the `NamedOnnxValue` which doesn't play well with `DisposableNamedOnnxValue` since `DisposableNamedOnnxValue` just maintains a wrapper over the native memory containing the output of Run(). 

2) We could support an input to Run() containing `DisposableNamedOnnxValue`  by adding some guard logic to prevent pinning in that case and directly re-using the native memory but chances of that being useful are very low because both `NamedOnnxValue` and `DisposableNamedOnnxValue` are bound to "feed names" and hence validation of the input will eventually fail unless we run into the very rare chance that the output name of one model exactly matches the input name of the next model. Even in your toy example, even though the shapes match the names are different. 

3) As it stands, you can get it to work with something like this - 
```
                var container1 = new List<NamedOnnxValue>();
                var tensorIn = new DenseTensor<float>(....);
                var nov1 = NamedOnnxValue.CreateFromTensor("input", tensorIn);
                container1.Add(nov1);
                var res1 = session1.Run(container1); // This is not disposed

                var container2 = new List<NamedOnnxValue>();
                var nov2 = NamedOnnxValue.CreateFromTensor("input", res1.First().AsTensor<float>().ToDenseTensor()); // .ToDenseTensor() copies contents over
                container2.Add(nov2 );
                var res2 = session.Run(container2);
```
4) The above will work but is not optimal -
     i) It will create another managed buffer and copy over the contents of the results of the first run
    ii) It will create another OrtValue instance (for the new input) before calling into native code. Ideally we should be able to re-use the OrtValue instance created from the output of the first Run()

5) There is a PR by @fs-eire (https://github.com/microsoft/onnxruntime/pull/3171) that will eventually solve it. It introduces a new class `PinnedOnnxValue` that can help re-use the underlying OrtValue value instances and there are several Run() overloads that will take in PinnedOnnxValues. You can use PinnedOnnxValue for the output of the first Run() and use the same for the input of the next Run() and that will solve the problem. 

